function App() {
  const options = {
    method: "GET",
    headers: {
      "X-RapidAPI-Key": "3dc1a90a57msh1832834cdf55bdep1ed1b2jsnc624f5031a4f",
      "X-RapidAPI-Host": "hotels-com-provider.p.rapidapi.com",
    },
  };

  fetch(
    "https://hotels-com-provider.p.rapidapi.com/v1/hotels/photos?hotel_id=363464",
    options
