    .then((response) => response.json())
    .then((response) => console.log(response))
    .catch((err) => console.error(err));

  return (
    <div>
      <h2>Travel App</h2>
      {/* <Home /> */}
      {/* <Country2 /> */}
      {/* <CountryImage /> */}
      <Search />
    </div>
  );
}

export default App;
